    <script>
        function downloadImg(fileName)
        {
            var image = document.getElementById('image');
            var a = document.createElement("a");
            a.href = image.src;
            a.download = fileName;
            a.rel = 'noopener'
            document.body.appendChild(a)
            a.click();
            document.body.removeChild(a)
        }
